import React from 'react'

const Cart = ({ cartItems }) => {
    // You can render cart items here
    return (
        <div>
            <h2>Cart</h2>
            <ul>
                {cartItems.map((item, index) => (
                    <li key={index}>{item.foodName}</li>
                ))}
            </ul>
        </div>
    )
}

export default Cart
